parameters.jsCode:
// Get the incoming JSON body
const input = items[0].json;

// Navigate to the transcript array
const transcript = input.body.data.transcript;

// Build Markdown
let md = `# Conversation Transcript\n\n`;

transcript.forEach((turn) => {
  const role = turn.role === "agent" ? "**Agent**" : "**User**";
  const message = turn.message ? turn.message.trim() : "";

  md += `${role}:\n\n${message}\n\n---\n\n`;
});

// Optionally include extracted analysis metadata
const analysis = input.body.data.analysis?.data_collection_results;

if (analysis) {
  md += `# Extracted Metadata\n\n`;

  if (analysis.feedback_subject?.value) {
    md += `**Feedback Subject:** ${analysis.feedback_subject.value}\n\n`;
  }

  if (analysis.feedback?.value) {
    md += `**Feedback Provided:**\n\n${analysis.feedback.value}\n\n`;
  }

  if (analysis.improve?.value) {
    md += `**Areas for Improvement:**\n\n${analysis.improve.value}\n\n`;
  }

  if (analysis.howoften?.value) {
    md += `**Frequency of Interaction:** ${analysis.howoften.value}\n\n`;
  }
}

// Return markdown as output
return [
  {
    json: {
      markdown: md
    }
  }
];

